import { useEffect } from "react"
import { useSelector } from "react-redux"
import { getStatus } from "../../../redux/async/profileThunk"
import ProfileStatus from "./ProfileStatus"

const ProfileStatusHOC = () => {
    useEffect(()=>{
        getStatus(props.userId)
    },[])

    const status = useSelector(state => state.profilePage.user.userId)
    return <ProfileStatus status={status}/>
}

export default ProfileStatusHOC
